import Axios from 'axios';
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

Axios.render.baseURL = 'http://localhost:3000/';
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
